  <tr>
    <td>「鮮度たもつくん」は成熟・老化を促す働きを持つエチレンガスを吸着・分解して野菜・果物の鮮度を保ちます！<br>
      <br>
      <span class="txtstyle01">【エチレンガスとは？】</span><br>
        野菜や果物は、エチレンという植物ホルモンの作用で生長し、熟成していきます。
そして、収穫した後も呼吸をし、どんどんエチレンガスを放出して老化に至ります。
これが一般的に言われます、腐るという現象で、最後には種だけが残ります。
この様に野菜や果物の生長にエチレンは必要不可欠なものですが、
収穫後は自ら、または周辺の野菜や果物までをも傷めることになります。<br>
鮮度たもつくんは、このエチレンガスを吸着・分解し、野菜や果物の鮮度を保つ商品です。 <br>
        <br>
        <span class="txtstyle01">【使用方法】</span><br>
        ・冷蔵室・野菜室に入れるだけです！</td>
  </tr>
